import React, { useState } from "react";
import ReactDOM from "react-dom";
import Slider from "./Slider";

import Testimonialone from "./Testimonialone";
import Testimonialtwo from "./Testimonialtwo";

function App() {

  const[translate,setTranslate] =useState(`translateX({0%)`)
  return (
    <main>
      <div className="over_flow">
        <Testimonialone translate={translate} setTranslate={setTranslate}/>

        <Testimonialtwo />
      </div>

      <Slider setTranslate={setTranslate}/>
    </main>
  );
}

export default App;
